Among them, the international community could: 
• provide strong international financial and technical assistance to the Ukrainian 
government to avert a financial meltdown;
• deliver meaningful and urgent international technical assistance to Ukraine on 
anticorruption and institutional reform efforts to strengthen public confidence;
• develop, provide, and otherwise support technology to strengthen the Ukrainian 
government and civil society initiatives that advance reforms and transparency and 
contribute to internal stability;
• offer trade incentives to strengthen Ukraine’s economy;
• back small- and medium-sized enterprises, including with low-interest loans, to rapidly 
develop the legitimate private sector and boost the economic recovery;
• support civil society organizations and independent media for public education, 
information, and media literacy to empower Ukrainian citizens and counter the effects 
of Russian propaganda;
• apply Western values actively and consistently, without shying from criticism of rights 
violations in Russia or corruption in Ukraine;
